        <button>Fecha de subida (más antiguos)</button>
        <button>Fecha de subida (más recientes)</button>
      </div>

      <style jsx>{`
        .sort {
          position: relative;
        }
        .sort-dropdown {
          display: inline-block;
          width: 10em;
        }
        span {
          transform: rotate(180deg);
        }
      `}</style>
    </div>
  );
}
